window.bookSummaryJSON = "<p><b>I didn't believe them when they said they would corrupt me. I was wrong. So wrong.</b></p> <p>The night my sister died, a piece of me died with her. So I made a vow to enroll at Spine Ridge University just like her, find the person responsible… and make them pay.</p> <p>Until I meet three sick boys of the Skull &amp; Serpent Society: Felix, Dylan, Alistair. Rude, heartless, vicious guys who are obsessed with making me regret I ever stepped foot on campus.</p> <p>They make me a deal: My body in exchange for a glimpse at their violence. Refusing them is impossible; denying them is insane. They're rough, greedy, and every second with them is filled with depravity. Their venom is jabbed straight into my heart, and I'm sucked into their world. All for the sake of revenge.</p> <p>Until it becomes something more. Something priceless. Something all four of us would kill for.</p> <p><i>Sick Boys </i>is a thrilling new dark bully reverse harem romance standalone by <i>New York Times</i> &amp; <i>USA Today</i> bestselling author Clarissa Wild. Intended for mature listeners.</p>"; 
